def read_table(n: int) -> list[list]:    table = []    counter = 0    while counter < n:        k = 0        input_row = list(map(int, input(f"{counter + 1}-я строка:\t").split()))        if len(input_row) != 0:            k = input_row[0]        if (len(input_row) != k + 1):            print('Не верный ввод строки!')            continue        table.append(input_row[1:])        counter += 1    return tableif __name__ == "__main__":    n = int(input('n:\t'))    if n > 100:        n = 100    if n < 2:        n = 2    table = read_table(n)    oriented = False    for i in range(len(table)):        for j in range(len(table)):            if (i + 1) in table[j] and not (j + 1) in table[i]:                oriented = True                break    print("YES" if oriented else "NO")